import React,{Component} from 'react';
import MainLayout from '../components/layouts/mainLayout'

class Home extends Component{
  constructor(props){
    super(props)
    console.log(props)
  }
  render(){
    console.log(this.props.user)
    return(
      <MainLayout>
         <h1>welcome to homepage</h1>
      </MainLayout>
    )
  }
}

Home.getInitialProps=(ctx)=>{
  return {
    user:{
      name:'abhishek',
      lastname:'jones'
    }
  }
}

export default Home
